    issueType(name: $type) @include(if: $withType) {
      ...IssueTypePickerIssueType
      id
    }
    owner {
      __typename
      ... on ProjectV2Owner {
        __isProjectV2Owner: __typename
        projectsV2ByNumber(first: 20, numbers: $projectNumbers) @include(if: $withProjects) {
          nodes {
